// src/components/BookingDetails.js
import React from 'react';

const BookingDetails = ({ selectedSpot, customerName, vehicleNumber, bookingDuration }) => {
  return (
    <div className="mt-4">
      <h3>Rincian Pemesanan</h3>
      {selectedSpot ? (
        <div>
          <p><strong>Nama:</strong> {customerName}</p>
          <p><strong>Nomor Kendaraan:</strong> {vehicleNumber}</p>
          <p><strong>Tempat Parkir:</strong> P{selectedSpot}</p>
          <p><strong>Durasi Parkir:</strong> {bookingDuration} jam</p>
        </div>
      ) : (
        <p>Belum ada pemesanan yang dilakukan.</p>
      )}
    </div>
  );
};

export default BookingDetails;
